import styles from './index.module.scss'
import { memo } from 'react'
import { Input, Button } from 'antd'

const TodoList = memo(() => {
  return (
    <div className={styles.wrapper}>
      <div className={styles.header}>
        <Input/>
      </div>
    </div>
  )
})

export default TodoList
